    const classes = useStyles();

  return (
    <Card className={classes.root}>
        <CardHeader  title='Expense Tracker' subheader='Powered by Speechly'/>
        <CardContent>
            <Typography align='center' variant='h5'>Total Balance $100</Typography>
            <Typography align='center' variant='h5'>Total Balance $100</Typography>
        </CardContent>
